use mydatabase;
drop table if exists Users;
create table Users(
    user_id				int(5),
    user_name			varchar(20) not null,
    gender				varchar(6),
    age					int(2),
    location			varchar(20),
    time_online_daily	decimal(4, 2),
    primary key(user_id)
);

drop table if exists Videos;
create table Videos(
	video_id			int(5),
    view_count			int(10),
    duration			int(5),
    finishing_rate		decimal(4, 2),
    like_rate			decimal(4, 2),
    primary key(video_id)
);

drop table if exists Tags;
create table Tags(
	tag_id 				int(3),
    tag_name			varchar(20) not null
);

drop table if exists Ads;
create table Ads(
	Ad_id				int(5),
    content				varchar(100),
    total_click			int(10),
    fee_rate 			char(1),
    appropriate_degree	decimal(3, 2),
	profit				decimal(6, 2),
    AP_id				int(5) not null,
    primary key(Ad_id)
);

drop table if exists AdProviders;
create table AdProviders(
	AP_id			int(5),
    AP_name			varchar(30),
    quantity		int(10),
    primary key(AP_id)
);

drop table if exists Clicks;
create table Clicks(
	user_id			int(5),
    Ad_id			int(5),
    primary key(user_id, Ad_id)
);

drop table if exists Correlations;
create table Correlations(
	video_id	 	int(5),
    tag_id			int(3),
    primary key(video_id, tag_id)
);

drop table if exists Likes;
create table Likes(
	user_id			int(5),
    video_id 		int(5),
    primary key(user_id, video_id)
);

drop table if exists Publishments;
create table Publishments(
    video_id		int(5),
    user_id	 		int(5),
    primary key(video_id, user_id)
);

drop table if exists Preferences;
create table Preferences(
	user_id			int(5),
    tag_id			int(3),
    primary key(user_id, tag_id)
);

drop table if exists Targets;
create table Targets(
	Ad_id 			int(5),
    tag_id	 		int(3),
    primary key(Ad_id, tag_id)
);

